import React, { Component } from 'react';
import './App.css';
import ViewStacks from './ViewStacks';

/**************
This page decides which page to show

**************/

class App extends Component {
  render() {
    return (
      <div className="App">
        <ViewStacks />
      </div>
    );
  }
}

export default App;
